import React, {Component} from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import Top from './Top';

class App extends Component {
  render(){
  return (
    <div>
      <Top/>
    <Container>
      <Row>
        <Col>
          <h1>Hallo</h1>
        </Col>
      </Row>
    </Container>
    </div>
  );
}
}

export default App;
